import styled from "styled-components";

const Container = styled.div`
  height: 100px;
  width: 100%;
  display: flex;
  justify-content: space-between;
  align-items: center;
  margin: 0 auto;
  padding: 0 10%;
  background-color: black;
  color: white;
`;

const Menubar = styled.div`
  height: 50px;
  width: 50px;
`;

// 가로선을 위한 스타일 추가
const Line = styled.span`
  display: block;
  width: 100px; /* 선의 길이 조정 */
  height: 1px; /* 선의 두께 */
  background-color: white; /* 선의 색상 */
  margin-right: 10px; /* 텍스트와 선 사이의 간격 */
`;

export function Navbar() {
  return (
    <>
      <Container>
      <Line /> {/* 가로선 추가 */}
        <h3>UNTITLED</h3>
        <img src={Menubar} width="100%" height="100%" />
      </Container>
    </>
  );
}
